import AppProvider from '../components/AppProvider';
import { Layout } from '../components';
import { AppDownload, RequestService, OfficeSolution, BecomePartner } from '../components/Homepage';

function Homepage(props) {
  return (
    <AppProvider>
      <Layout>
        <div className="Homepage">
          <AppDownload />
          <RequestService />
          <OfficeSolution />
          <BecomePartner />
        </div>
      </Layout>
    </AppProvider>
  );
}

export default Homepage;
